[{"location":"#SpinShuttling.jl-Documentation","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"","category":"section"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"CurrentModule = SpinShuttling","category":"page"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"OneSpinModel","category":"page"},{"location":"#SpinShuttling.OneSpinModel","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.OneSpinModel","text":"General one spin shuttling model initialized at initial state |Ψ₀⟩,  with arbitrary shuttling path x(t). \n\nArguments\n\nΨ::Vector{<:Number}: Initial state of the spin system, the length of the vector must be `2^n\nT::Real: Maximum time\nM::Int:  Monte-Carlo sampling size\nN::Int: Time discretization\nB::GaussianRandomField: Noise field\nx::Function: Shuttling path\n\n\n\n\n\nOne spin shuttling model initialzied at |Ψ₀⟩=|+⟩. The qubit is shuttled at constant velocity along the path x(t)=L/T*t,  with total time T in μs and length L in μm.\n\n\n\n\n\n","category":"function"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"TwoSpinModel","category":"page"},{"location":"#SpinShuttling.TwoSpinModel","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.TwoSpinModel","text":"General two spin shuttling model initialized at initial state |Ψ₀⟩, with arbitrary shuttling paths x₁(t), x₂(t).\n\nArguments\n\nΨ::Vector{<:Number}: Initial state of the spin system, the length of the vector must be `2^n\nT::Real: Maximum time\nM::Int:  Monte-Carlo sampling size\nN::Int: Time discretization\nB::GaussianRandomField: Noise field\nx₁::Function: Shuttling path for the first spin\nx₂::Function: Shuttling path for the second spin\n\n\n\n\n\nTwo spin shuttling model initialized at the singlet state |Ψ₀⟩=1/√2(|↑↓⟩-|↓↑⟩). The qubits are shuttled at constant velocity along the path x₁(t)=L/T₁*t and x₂(t)=L/T₁*(t-T₀).  The delay between the them is T₀ and the total shuttling time is T₁+T₀. It should be noticed that due to the exclusion of fermions, x₁(t) and x₂(t) cannot overlap.\n\n\n\n\n\n","category":"function"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"fidelity","category":"page"},{"location":"#SpinShuttling.fidelity","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.fidelity","text":"Sample a phase integral of the process.  The integrate of a random function should be obtained  from directly summation without using high-order interpolation  (Simpson or trapezoid). \n\n\n\n\n\n","category":"function"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"sampling","category":"page"},{"location":"#SpinShuttling.sampling","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.sampling","text":"Monte-Carlo sampling of any objective function.  The function must return Tuple{Real,Real} or Tuple{Vector{<:Real},Vector{<:Real}}\n\n\n\n\n\nSampling an observable that defines on a specific spin shuttling model  objective(mode, randseq, vector)\n\n\n\n\n\n","category":"function"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"averagefidelity","category":"page"},{"location":"#SpinShuttling.averagefidelity","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.averagefidelity","text":"Calculate the average fidelity of a spin shuttling model using numerical integration  of the covariance matrix.\n\n\n\n\n\n","category":"function"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"OrnsteinUhlenbeckField","category":"page"},{"location":"#SpinShuttling.OrnsteinUhlenbeckField","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.OrnsteinUhlenbeckField","text":"Ornstein-Uhlenbeck field, the correlation function of which is  σ^2 * exp(-|t₁ - t₂|/θ_t) * exp(-|x₁-x₂|/θ_x)  where t is time and x is position.\n\n\n\n\n\n","category":"type"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"PinkBrownianField","category":"page"},{"location":"#SpinShuttling.PinkBrownianField","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.PinkBrownianField","text":"Pink-Brownian Field, the correlation function of which is σ^2 * (expinti(-γ[2]abs(t₁ - t₂)) - expinti(-γ[1]abs(t₁ - t₂)))/log(γ[2]/γ[1]) * exp(-|x₁-x₂|/θ) where expinti is the exponential integral function.\n\n\n\n\n\n","category":"type"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"RandomFunction","category":"page"},{"location":"#SpinShuttling.RandomFunction","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.RandomFunction","text":"Similar type of RandomFunction in Mathematica. Generate a time series on a given time array subject to  a Gaussian random process traced from a Gaussian random field.\n\n\n\n\n\n","category":"type"},{"location":"","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.jl Documentation","text":"Χ","category":"page"},{"location":"#SpinShuttling.Χ","page":"SpinShuttling.jl Documentation","title":"SpinShuttling.Χ","text":"Theoretical fidelity of a sequenced two-spin EPR pair shuttling model.\n\n\n\n\n\nTheoretical fidelity of a one-spin shuttling model.\n\n\n\n\n\nTheoretical fidelity of a one-spin shuttling model for a pink noise.\n\n\n\n\n\n","category":"function"}]
